    value: 'Please be advised that expenditures for employees who spend more than
      25% of their compensated time on Federal Election Activity are detailed on Schedule
      B supporting Line 30.      RE: Amended May Monthly Report (04/01/12-04/30/12)  1.
      The Committee has requested complete information that is required for disclosure
      and best efforts.  The original solicitation included a clear and conspicuous
      request for the contributor information and informed the contributor of the
      requirements of federal law for the reporting of such information.  For those
      that the information was not provided, we made a follow-up, stand alone effort
      to obtain the information.  The amended report reflects any updated information
      we have received.  2. The Committee participated in State Convention Lunch 3/16/12
      and made a corresponding payment to the Rochester Convention Center on 4/23/12.  Additionally,
      there were transfers made to the allocation account according to the dollar
      in/dollar out ratio on 4/30/12.    3. The report has been amended to provide
      the purpose for each disbursement on Schedule H4.  4. Schedule H4 has been amended
      to include all payments that make up staff reimbursements.   5. Schedule H4
      supporting Line 21(a) of the aforementioned report discloses payments for communications
      consultants. None of the payments disclosed on Schedule H4 are for communications
      that refer to a clearly identified federal candidate. Any such expenditure is
      disclosed on Schedule B for supporting Line 30.    6. The allocated activity
      or event year-to-date total calculations for Administrative category have been
      amended.'
